import React,  { useState, useEffect} from 'react'
import { useParams } from 'react-router'
import Navbar from '../components/Navbar/Navbar'

const RasteroPagina = () => {

  const [trackedGuide, setTrackedGuide] = useState("")
  const [guideInformation, setguideInformation] = useState()

  const params = useParams()
  console.log(params.guide);


  const getGuideInfo = async () => {

    const requestOptions = {
        method: 'POST',
        headers: { 
          'Content-Type': 'application/json',
          'Access-Control-Allow-Origin': 'http://test.quiken.mx/track'
       },
        body: {
          "clientDetail": {
            "accountName": "alan.monreal@envia.com",
            "apiKey": "j4LKgcw8P59BqWLdbVWPEH5YAlRE22V3"
          },
          "trackingNumbers": [
            100328
          ]
        }
    };

    const response = await fetch('http://test.quiken.mx/track', requestOptions)
    console.log(response)

  }




  useEffect(() => {
    getGuideInfo()  
  }, [])


  return (
    <>
      <Navbar/>
      <div>Hellow From Rastero</div>
    </>  
  )
}

export default RasteroPagina;
